import pageHeading from "./assets/images/page-heading.jpeg";
import pageHeadingPattern from "./assets/images/page-heading-pattern.png";
import logoLg from "./assets/images/logo.png";
import player from "./assets/images/tyronethompson.png";

import {
  Radar,
  RadarChart,
  Legend,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  ResponsiveContainer,
} from "recharts";

import PlayerDetail from "./PlayerDetails";
import PlayerCircularStats from "./PlayerCircularStats";
import PlayerTitle from "./PlayerTitle";
import {
  PlayerInfo,
  PlayerInfoItem,
  PlayerInfoItemCard,
  PlayerInfoItemCardContent,
  PlayerPhoto,
  StyledPlayerHeading,
  TeamLogo,
} from "./styled-components";
import PlayerStats from "./PlayerStats";

const data = [
  { subject: "OFF", A: 120 },
  { subject: "AST", A: 98 },
  { subject: "TCK", A: 86 },
  { subject: "TRY", A: 99 },
  { subject: "PAS", A: 85 },
  { subject: "DEF", A: 65 },
];

interface Props {

}

const PlayerHeading = () => {
  return (
    <StyledPlayerHeading>
      <div className="container mx-auto">
        <TeamLogo>
          <img src={logoLg} alt="logo" />
        </TeamLogo>

        <PlayerTitle
          className="mobile"
          firstName="Tyrone"
          lastName="Thompson"
          number="6"
        />

        <PlayerInfo>
          <PlayerInfoItemCard>
            <PlayerInfoItemCardContent>
              <PlayerInfoItem className="photo" aria-hidden="false">
                <PlayerPhoto>
                  <img src={player} alt="" />
                </PlayerPhoto>
              </PlayerInfoItem>
              <PlayerInfoItem className="details" aria-hidden="false">
                <PlayerTitle
                  firstName="Tyrone"
                  lastName="Thompson"
                  number="6"
                />
                <PlayerDetail />
                <PlayerCircularStats />
              </PlayerInfoItem>
              <PlayerInfoItem className="stats" aria-hidden="false">
                  <PlayerStats />
              </PlayerInfoItem>
            </PlayerInfoItemCardContent>
          </PlayerInfoItemCard>
        </PlayerInfo>
      </div>
    </StyledPlayerHeading>
  );
};

export default PlayerHeading;
